import React, { useEffect, useState } from 'react';
import './dashboardsuperadmin.css'
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { getadmin, getUserCount, getAdminCount, getSuperadminCount } from './utils/ApiRequest';

const Dashboardsuperadmin = () => {
  const navigate = useNavigate();
  const [userCount, setUserCount] = useState(0);
  const [adminCount, setAdminCount] = useState(0);
  const [superadminCount, setSuperadminCount] = useState(0);

  useEffect(() => {
    const fetchData = async () => {
      try {
        if (localStorage.getItem("super")) {
          const { data: userData } = await axios.post(getUserCount);
          setUserCount(userData.count);
          const { data: adminData } = await axios.post(getAdminCount);
          setAdminCount(adminData.count);
          const { data: superadminData } = await axios.post(getSuperadminCount);
          setSuperadminCount(superadminData.count);
        } else {
          navigate("/superadminlogin");
        }
      } catch (error) {
        console.error('Error fetching data:', error);
        // Handle error (e.g., redirect to an error page)
      }
    };

    fetchData();
  }, [navigate]);

  return (
    <>
      <div className="sidenavbar">
        <Link to='/dashboards-a'>Dashboard</Link>
        <Link to='/create-admin'>Create Admin</Link>
        <Link to='/superadmin'>View Admin</Link>
        <Link to='/manage-users'>Manage users</Link>
        <Link to='/Complaint'>Complaint</Link>
      </div>
      <table className="dashboard-table w-90">
        <thead>
          <tr>
            <th>Section</th>
            <th>Description</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td><strong>Overview Section:</strong></td>
            <td>
              <ul>
                <li>Total Number of Users: {userCount}</li>
                <li>Total Number of Admins: {adminCount}</li>
                <li>Total Number of Superadmins: {superadminCount}</li>
                {/* Add more data as needed */}
              </ul>
            </td>
          </tr>
          {/* Add other sections here similarly */}
        </tbody>
      </table>
    </>
  );
}

export default Dashboardsuperadmin;
